result:
.sellerDetail {
    padding: 10px;
    background: #e5e9f2;
    /* margin-top: 50px; */
}
.el-dialog__wrapper {
    left: 0 !important;
}

.demo-ruleForm {
    width: 100%;
}

.demo-ruleForm .el-form-item {
    width: 33%;
    float: left;
}

.clears:after {
    display: block;
    clear: both;
    content: "";
    visibility: hidden;
    height: 0;
}

.grid-content:after {
    display: block;
    clear: both;
    content: "";
    visibility: hidden;
    height: 0;
}

.grid-content span {
    float: left;
}

.grid-content span:last-child {
    max-width: 75%;
}

.el-message-box__wrapper {
    position: fixed;
    top: -20px;
    bottom: 0;
    left: 0px !important;
    right: 0;
    text-align: center;
}

ul li {
    list-style: none;
    border-bottom: 1px solid #ddd;
    height: 46px;
    line-height: 46px;
    width: 100%;
    display: block;
}

ul li a {
    margin-right: 10px;
}

.button {
    cursor: pointer;
    color: #fff;
    background-color: #409eff;
    border-color: #409eff;
    padding: 8px 16px;
    font-size: 14px;
    border-radius: 4px;
    margin-left: 10px;
    text-align: center;
    box-sizing: border-box;
    outline: none;
    margin-top: 6px;
    transition: 0.1s;
    border: 1px solid #dcdfe6;
    float: right;
}

.view {
    color: #409eff;
    cursor: pointer;
}

#logs li {
    font-size: 14px !important;
    border-bottom: 1px solid #ddd;
    height: 25px !important;
    line-height: 25px !important;
}

.title {
    font-weight: 600;
    font-size: 18px;
    margin: 5px 0 !important;
    border-bottom: 1px solid #99a9bf;
    padding-bottom: 8px;
}

.label {
    font-size: 16px;
    margin-right: 10px;
}

.grid-content {
    background: #fff;
    padding: 10px;
    box-sizing: border-box;
}

.el-table__empty-block {
    background: #fff;
}
